            </div>
            <div className="custom-heading">
                <h1 className="gradient__text">Hell World</h1>
                <p>Hello World</p>
            </div>
            <div className="custom-container">
                <Feature title="Technology" text="Hello World i just need to add a ton of text to describe the actual projec that that I plan to use for the purpose of describing some of my work and various technologies that i may be using just so that i can advertise myself and im just trying to fill in words to make it look like a proper convo"/>
